import React , { Component } from 'react';
import css from './assets/Header';

class Header extends Component {
    render() {
        const headerStyle = {
            width : '100%' ,
            height: '50px' ,
            background : '#000000',
            boxShadow : '0px 5px',
            clear: 'both'
        }
        const title = {
            margin: 0,
            color : '#ffffff',
            lineHeight : '50px',
        }
        const titleArea = {
            width: '1024px',
            margin : '0 auto'
        }
        return(
            <div style={headerStyle}>
                <div style={titleArea}>
                <h4 style={title}>김종인의 블로그</h4>
                </div>
            </div>
        )
    }
}

export default Header;
